import React from 'react';
import './stylesFiles/createAccount.css';

const CreateAccount = () => {
    return (
        <div style={{backgroundImage:"linear-gradient(to bottom right,black,darkblue)"}}>
            <h1 style={{fontSize:"4vw"}}>Create Account</h1>
            <form action="#">
                <ul style={{listStyleType:"none", display:"grid"}}>
                    <li>
                        <input placeholder="First name"/>
                    </li>
                    <li>
                        <label>Last Name<input/></label>
                    </li>
                    <li>
                        <label>First Name<input/></label>
                    </li>
                </ul>
            </form>
        </div>
    );
}

export default CreateAccount;
